import React, { useState } from 'react';
import '../styles/Project.css';

function ProjectTile({ projectImg, handleImg, gitHub, liveLink }) {
    function changeImg(e) { e.target.style.img.src = 'handleImg'; }
    return (
        <a href={liveLink} target="blank" className="projectTile"><img src={projectImg} className="img-fluid projectImage" alt="Lazy Layover Home Page" onMouseOver={handleImg} onMouseLeave={projectImg}></img><i class="fab fa-github" aria-hidden="true">{gitHub}</i></a>
            );
    }

export default ProjectTile;
